import React from "react";
import Data from "./Data";

function App(props){
    return(
        <>
           <div className="main">
              <div className="img">
                <img src={Props.imgsrc} alt="series-img"/>;
              </div>  
              <div className="title">
                <h2>{props.title}</h2>
              </div>  
              <div className="name">
                <h2>{props.name}</h2>
              </div>  
              <div>
                <a href={props.reference} target="_blank">
                    <button>Watch Now</button>
                </a>
              </div>  
           </div>
        </>
    );
}

export default App;
